import './App.css';
import ModalPersona from './ModalPersona.js'
import Button from '@mui/material/Button';
import Card from '@material-ui/core/Card';
import Header from './Header.js'
import React from 'react';
import Divider from '@material-ui/core/Divider';

function App() {

  const [open, setOpen] = React.useState(false);
  const handleOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);
  const handleClick = () => setOpen(true);

  return (
    <div>
      <div className="header">
        <Card className="Card">
          <Header title="Datos de persona*" linkText="+Asignar Persona" handleClick={handleClick}></Header>
          <Divider variant="middle" />
          <span className="Card">Y aca va el resto del contenido</span>
        </Card>
      </div>
      <ModalPersona open={open} handleClose={handleClose}></ModalPersona>
    </div>
  );
}

export default App;
